void ProcessSigIo()
{
struct timeval	to;
fd_set		fdset;
int		c,x,y;
char		BUFF[8];

#ifdef TRACE_IT
TrBu[TrBuPtr]='P';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
#endif

#ifdef USE_KEYBOARD
	FD_ZERO(&fdset);
	FD_SET(0,&fdset);
	to.tv_sec=0;
	to.tv_usec=0;
	if(select(FD_SETSIZE,&fdset,0,0,&to)!=-1)
	{
		if(FD_ISSET(0,&fdset))
		{
			c=getchar();
			switch(c)
			{
				case 0xa:	// ReStart
					if(Sleeping)
					{
						ProcessGo=0;
						ContSignal=1;
						Sleeping=0;
						PriusIsPowered=1;
					}
					else
					{
						alarm(0);
						SaveStat();
						Sleeping=1;
						if(Port>=0)
						{
							sprintf(Message,"C\015");	// Close the CAN channel
							if(WriteToPort(Message)) {printf("\nError writing to port : Close CAN Channel");fflush(stdout);}
							close(Port);
							Port=-1;
						}

					}
				break;
				case 'q' :
					ProcessGo=0;
					RealQuit=1;
				break;

				case 's' :
					if(++SI_Measurements>1) SI_Measurements=0;
				break;

				case 'p' :
					PriusIsPowered=0;
					Sleeping=0;
					CurrentSpeed=0;
				break;

				case 0x7F : // BS
					if(++VoiceMode>1) VoiceMode=0;
				break;

				case ' ' :
					NeedSynced=1;
					FSRCntr=1;
				break;

			}
		}
	}
#endif

return;


#ifdef USE_TOUCHSCREEN
	FD_ZERO(&fdset);
	FD_SET(touch_screen_fd,&fdset);
	to.tv_sec=1;
	to.tv_usec=0;
	if(!ScrTouched) ScrTouched=1;
	if((c=select((touch_screen_fd+1),&fdset,NULL,NULL,&to)))
	{
		if(!ScrTouched) ScrTouched=2;
		if(FD_ISSET(touch_screen_fd,&fdset))
		{
			if((c=read(touch_screen_fd,BUFF,8))==8)
			{
				ScrTouched=3;
//				CopyDisplayBufferToScreen(0,0,WIDTH,HEIGHT);

				x=((int)(BUFF[5]*256)+(int)(BUFF[4]));
				y=(480-((int)(BUFF[3]*256)+(int)(BUFF[2])));	// 45:45  560:45  45:445   560:445
				TouchedX=x;
				TouchedY=y;

				if(RunningTask!=TASK_INFO)
				{
					if((x-=45)<0) x=0;
					if((x>>=7)>3) x=3;			// Map to 4 quadrants	// x= 0 ~ 3
					if((y>100)&&(y<400))
					{
						switch(x)
						{
							case 0 :
								if(++VoiceMode>1) VoiceMode=0;
							break;
							case 1 :
							case 2 :
								switch(RunningTask)
								{
									case TASK_INIT :
										RunningTask=TASK_INFO;
									break;
									case TASK_SCREENSAVER :		// Signal to save to memcard
										TouchedX=17;
										TouchedY=17;
									break;
									case TASK_RUNNING :
										if(++SI_Measurements>1) SI_Measurements=0;
									break;
								}
							break;
							case 3 :
								if(RunningTask<TASK_RUNNING)
								{
									ProcessGo=0;
									RealQuit=1;
								}
								else
								{
									PriusIsPowered=0;
									Sleeping=0;
									CurrentSpeed=0;
								}
							break;
						}
					}
				}
			}
		}
	}
#endif

#ifdef TRACE_IT
TrBu[TrBuPtr]='p';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
#endif

}

void IntReXSigCatch(int sig)
{
#ifdef TRACE_IT
TrBu[TrBuPtr]='X';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
#endif

//printf("\nSig:%d\n",sig);fflush(stdout);


	switch(sig)
	{
		case SIGIO :
			ProcessSigIo();
		break;
		case SIGALRM	:
			NeedSynced=1;
			signal(SIGALRM,IntReXSigCatch);
			if((ProcessGo)&&(RealQuit==0)&&(Sleeping==0)) alarm(1);
		break;
		case SIGQUIT	: 
			ProcessGo=0;
		break;
		case SIGCONT	:
			ProcessGo=0;		// When Power was restored...
			ContSignal=1;
			Sleeping=0;
			PriusIsPowered=1;
		break;
		case SIGSTOP	:
		case SIGTTIN	:
		case SIGPWR	: 
		case SIGILL	:
		case SIGFPE	:
		case SIGBUS	:
		case SIGSEGV	:
		case SIGPIPE	:
		case SIGINT	: 
		case SIGHUP	: 
		case SIGTERM	:
			printf("\nMisc Signal Cought, exiting (%d)",sig);fflush(stdout);
			CleanUp(0);
#ifdef TRACE_IT
TrBu[TrBuPtr]='x';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
#endif
			exit(-1);
	}
#ifdef TRACE_IT
TrBu[TrBuPtr]='x';if(++TrBuPtr>=TRACE_BUFFER_LENGTH) TrBuPtr=0;
#endif

}

